import "./Home.css";
import { BsBuilding } from "react-icons/bs";
import 'font-awesome/css/font-awesome.min.css';
import ApartmentIcon from '@material-ui/icons/Apartment';

const Home = () => {
    return (
        <div className="bg-img">
            <form action="" class="container">

            <div className="img" ><h3><BsBuilding/></h3>
                <span><input type="text" placeholder="To" name="From" required ></input>
                <input type="text" placeholder="From" name="to" required ></input></span>
                </div> 
                <input type="date" id="date" name="date" placeholder="Date" required></input>
                <input type="button" class="btn" value="Search Buses" required></input>
            </form> <ApartmentIcon/>
        </div>         
    )
}

export default Home;
